import React from 'react';
import { Link } from "react-router-dom";
import { css } from "@emotion/react";

const HomePage = () => {
  const linkStyle = css`
    text-decoration: none;
    color: white;
    font-size: 20px;
    font-weight: bold;
    margin-top: 20px;
    padding: 10px 20px;
    border-radius: 5px;
    background-color: #0072C6;
    &:hover {
      background-color: #0099FF;
    }
  `;

  const containerStyle = css`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    height: 100vh;
    background-color: #F0F4F7;
  `;

  const titleStyle = css`
    font-size: 40px;
    font-weight: bold;
    color: #0072C6;
    margin-bottom: 30px;
  `;

  return (
    <div css={containerStyle}>
      <h1 css={titleStyle}>Bockscar Device Tracker Home Page</h1>
      <Link css={linkStyle} to="/device-list">
        Go to Device List
      </Link>
    </div>
  );
};

export default HomePage;
